      submit: ''
    }
  }

  render(){

    const gretting = 'Escribeme';
    const estiloButton = 'br4-ns br3 ba color-boton ttu white center pt2 pb2 pr4 pl4 f4 f2-ns no-underline grow';

    return(

      <div>
          <Nav gretting={gretting} estiloButton={estiloButton}/>
          <HeroWindow gretting={gretting} estiloButton={estiloButton}/>
          <Cuerpo />

      </div>

    );
  }



}

export default App;
